import Layout from './Components/Layout/Layout';
import './App.css';
import OrderBuilder from '../src/Container/OrderBuilder/OrderBuilder';

function App() {
  return (
    <div className="App">
      <Layout>
          <OrderBuilder />
      </Layout>
    </div>
  );
}

export default App;
